date = parse(date_str).replace(tzinfo=pytz.timezone(from_tz))

    # Get the solar cycle year
    for cycle_year in SOLAR_CYCLE_YEARS:
        if date < pytz.timezone(to_tz).localize(datetime.date.today()):
            cycle_year -= 1
        if date >= pytz.timezone(to_tz).localize(datetime.date(cycle_year, 1, 1)):
            break

    # Calculate the solar activity
    years_since_cycle = (date.year - cycle_year) % 11
    x = years_since_cycle / 11 * np.pi
    return 0.5 * (1 + np.cos(x))

dt = parse(date_str).replace(tzinfo=pytz.timezone(from_tz))
    t = dt.astimezone(pytz.timezone(to_tz)).timetuple()
    solar_cycle_years = np.round(np.clip(np.diff(SOLAR_CYCLE_YEARS) / 365.0, 1.0, 10.0)).astype(int)
    years_since_solar_cycle_year = np.round(
        (t.tm_year - SOLAR_CYCLE_YEARS[0]) / solar_cycle_years
    ).astype(int)
    cos_cos_factor = np.cos(
        2.0 * np.pi * (years_since_solar_cycle_year % 11) / 11
    )
    return (0.33 + 0.66 * cos_cos_factor) * np.cos(
        2.0 * np.pi * (t.tm_yday / 365)
    )
